import "./App.css";
import "./Header.css";
import React from "react";

function Header() {
  return (
    <div class="container">
      <h1 class="banner">UF Trail Gators</h1>
      <nav>
      <a class="nav-link" href="/">Home</a> | 
      </nav>

    </div>
  );
}
//<a class="nav-link" href="/signup"> Signup</a>
export default Header;
